import { currPlaying, myPalette } from "../data";

export default function Home() {
  let paletteCounter = -1;

  const currPlayingMapped = currPlaying.map((p) => {
    paletteCounter++;
    return (
      <div
      key={p.name}
        className={`w-full h-[7.5rem] rounded-[1.5rem]
            absolute top-0`}
        style={{backgroundColor:myPalette[paletteCounter]}}
      ></div>
    );
  });

  
  return (
    <div
      className="w-full max-w-[60rem]
        flex flex-col md:flex-row font-light"
    >
      {/** ---- current favourite ---------- */}
      <section className="w-full">
        <article className="flex flex-col gap-4 text-black/70">
          <p className=" text-sm">CURRENT FAVOURITE</p>
          <h1
            className="font-bold
                    text-4xl md:text-6xl"
          >
            LA FILLE AUX CHEVEAUX DE LIN
          </h1>
          <div
            className="flex flex-col w-fit pt-2
                    border-t-2 border-black/70"
          >
            <h2 className="text-2xl md:text-3xl lg:text-4xl">384 days</h2>
            <p className="text-xs md:text-sm">worth of practice</p>
          </div>
        </article>
      </section>
      {/** ---- currently playing  ---------- */}
      <section className="w-full">
        <div className="w-full h-fit rounded-[2rem] p-4
         bg-white  text-black/70
        flex flex-col gap-4">
            <p className="text-sm px-2">CURRENTLY PRACTICING</p>
            <div className="flex flex-col relative">
                {currPlayingMapped}
            </div>
            
        </div>
      </section>
    </div>
  );
}
